When I first tried to set the column widths of the table I too got this error. But what I found was that I was accessing the columns starting at 1, but the columns are zero based. Also, I did not set the column width via tableColumnModel I did it straight from the table:

myTable = new qx.ui.table.Table(tableModel);
myTable.setColumnWidth(0,45);
myTable.setColumnWidth(1,145);
myTable.setColumnWidth(2,100);

etc.
